import Link from "next/link";
import { useRouter } from "next/router";
import { Nav, Navbar, NavItem } from "react-bootstrap";
import Router from "next/router";
const handleClickIndex = () => Router.push({ pathname: "/" });
const routes = [
  { href: "/", label: "Home" },
  { href: "/about", label: "About" },
  { href: "/contact", label: "Contact" },
];
function Header() {
  const router = useRouter();
  return (
    <>
      <div className={styles.title} >
        <Nav
          className="container flex nav-fill flex-wrap flex-sm-row mx-auto"
          id="tabs-text"
          pills
          role="tablist"
        >
          <Navbar className=" nav-left">
            <a onClick={() => handleClickIndex()}>
              <img src="/ast-logo.png" alt="AST" width="50" height="40" />
            </a>
          </Navbar>

          <Navbar className=" nav-right">
            {routes.map((route) => (
              <li key={route.label}>
                <Link href={route.href}>
                  <a
                    className={`px-3 ${
                      router.pathname === route.href ? "text-primary-500" : ""
                    }`}
                  >
                    {route.label}
                  </a>
                </Link>
              </li>
            ))}
          </Navbar>
        </Nav>
      </div>
    </>
  );
}

export default Header;
